use strict;
use warnings;

use common::sense;

use Carp;
use MongoDB;

$| = 1;

sub safe_access {
  my ($code) = @_;
  my $result = eval {
    &$code();
  };
  my $error = $@;
  if ($error && ! defined($result)) {
    carp("Database error: $@");
  }
}

sub process {
  my $database_name = "heliotrope";
  my $database_server = "fervdb-dev.oicr.on.ca:27017";
  my $local_server = "localhost:27017";

  my @options = (dt_type => undef, query_timeout => -1, auto_reconnect => 1, auto_connect => 0);

  my %publications = ();
  my %genes = ();

  while(<main::DATA>) {
    chomp;
    my ($gene, $sense, $identifiers) = split(/\s+/, $_);
    $sense = ((!!$sense) || 0);   # Force to 1,0
    my $sense_string = ($sense == 0) ? "negative" : "positive";
    my @identifiers = split(/;/, $identifiers);
    foreach my $identifier (@identifiers) {
      if (defined(my $current_sense = $publications{$identifier}->{$gene})) {
        if ($current_sense != $sense) {
          croak("Sense conflict for $gene, $identifier");
        } else {
          carp("Sense duplicate for $gene, $identifier");
        }
      } else {
        $publications{$identifier}->{$gene} = $sense;
        push @{$genes{$gene}->{$sense_string}}, $identifier;
      }
    }
  }

  my $publication_count = keys %publications;
  my $gene_count = keys %genes;
  say "$publication_count publications";
  say "$gene_count genes";

  my %senses = 0;

  foreach my $identifier (sort { $a <=> $b } keys %publications) {
    foreach my $gene (sort keys %{$publications{$identifier}}) {
      my $sense = $publications{$identifier}->{$gene};
      $senses{$identifier}->{$sense} = 1;
    }
  }

  my @dual_senses = grep { my $count = keys %{$senses{$_}}; $count > 1; } keys %senses;
  my $dual_sense_count = @dual_senses;
  say "$dual_sense_count dual sense count";

  say (100 * $dual_sense_count / $publication_count) . "% of publications";

  say "Building local publication collection";

  my $remote_conn = MongoDB::MongoClient->new(host => $database_server, @options);
  $remote_conn->connect();
  my $remote_database = $remote_conn->get_database($database_name);
  my $publications_collection = $remote_database->get_collection('publications');

  my $local_conn = MongoDB::MongoClient->new(host => $local_server, @options);
  $local_conn->connect();
  my $local_database = $local_conn->get_database($database_name);
  my $weeber_publications_collection = $local_database->get_collection('weeber_publications');
  my $weeber_genes_collection = $local_database->get_collection('weeber_genes');

  $weeber_publications_collection->remove();
  $weeber_genes_collection->remove();

  my %pmid_table = ();

  foreach my $identifier (sort { $a <=> $b } keys %publications) {
    my $document = $publications_collection->find_one({name => "pmid:$identifier"});
    if (! $document) {
      carp("Can't find: $identifier");
      next;
    }

    say "Adding pmid:$identifier";
    my $result = $weeber_publications_collection->insert($document);

    $pmid_table{$identifier} = $result;
  }

  # Now we need to push in the gene info.
  foreach my $gene (sort keys %genes) {
    my $data = $genes{$gene};
    foreach my $sense (keys %$data) {
      my @identifiers = @{$data->{$sense}};
      @identifiers = map {
        if (exists $pmid_table{$_}) {
          ($pmid_table{$_});
        } else {
          carp("Can't find: pmid:$_");
          ();
        }
      } @identifiers;
      $data->{$sense} = \@identifiers;
    }

    say "Adding $gene";
    $weeber_genes_collection->insert({name => $gene, references => $data});
  }
}

process();

